// Handle header action button clicks
onHeaderActionClick(event: HeaderActionClickEvent): void {
  console.log('Header action clicked:', event);
  
  // Handle different button actions
  switch (event.buttonId) {
    case 'create-user':
      // Open create user dialog or navigate to create user page
      this.router.navigate(['/users/create']);
      break;
      
    case 'export-data':
      // Export current data
      this.exportService.exportToCsv(this.data, 'exported-data.csv');
      break;
      
    case 'import-data':
      // Open file picker for import
      this.filePickerService.pickFile(['csv', 'xlsx'])
        .then(file => this.importService.importData(file));
      break;
      
    case 'refresh-data':
      // Reload data from server
      this.loadData();
      break;
      
    default:
      console.warn('Unknown action:', event.buttonId);
  }
}

// Button events provide:
// - buttonId: string - The ID of the clicked button
// - button: HeaderActionButton - Complete button configuration
// - event: Event - Original DOM click event
