export interface TableColumn {
  key: string;                    // Property key for data binding
  label: string;                  // Display header text
  type?: 'text' | 'badge' | 'date' | 'status' | 'avatar' | 'action';
  sortable?: boolean;             // Enable sorting for this column
  width?: string;                 // Custom column width (e.g., '150px', '20%')
  align?: 'left' | 'center' | 'right';
  format?: string;                // Date format or custom formatter
  badgeConfig?: {                 // Configuration for badge/chip columns
    colorMap?: { [key: string]: string };
    outlined?: boolean;
  };
}

export interface TableRowData {
  [key: string]: any;
  id?: string | number;           // Unique identifier for the row
}

export interface SortConfig {
  column: string;
  direction: 'asc' | 'desc' | null;
}

// Component API
@Component({
  selector: 'fa-table-list',
  // ... component configuration
})
export class TableListComponent {
  // Inputs
  @Input() columns: TableColumn[] = [];
  @Input() data: TableRowData[] = [];
  @Input() sortable: boolean = true;
  @Input() striped: boolean = true;
  @Input() hoverable: boolean = true;
  @Input() bordered: boolean = true;
  @Input() size: 'compact' | 'default' | 'comfortable' = 'default';
  @Input() loading: boolean = false;
  @Input() emptyMessage: string = 'No data available';
  @Input() sortConfig: SortConfig = { column: '', direction: null };

  // Outputs
  @Output() rowClick = new EventEmitter<TableRowData>();
  @Output() sortChange = new EventEmitter<SortConfig>();
  @Output() cellAction = new EventEmitter<{row: TableRowData, column: TableColumn, action: string}>();
}`}get basicTemplateCode(){return'<fa-table-list [columns]="columns" [data]="data"></fa-table-list>'}get basicTableCode(){return`// Basic table configuration
